<template>
<div class="geDiagramContainer" style="max-width: 100%; border: 1px solid transparent; position: relative; touch-action: none; cursor: pointer; overflow: hidden; margin-top: 26px; width: 625px; height: 338px;">
    <svg style="left: 0px; top: 0px; width: 100%; height: 100%; display: block; min-width: 625px; min-height: 338px; background-image: none; background-color: transparent;">
       <defs>
          <filter id="dropShadow">
             <feGaussianBlur in="SourceAlpha" stdDeviation="1.7" result="blur"></feGaussianBlur>
             <feOffset in="blur" dx="3" dy="3" result="offsetBlur"></feOffset>
             <feFlood flood-color="#3D4574" flood-opacity="0.4" result="offsetColor"></feFlood>
             <feComposite in="offsetColor" in2="offsetBlur" operator="in" result="offsetBlur"></feComposite>
             <feBlend in="SourceGraphic" in2="offsetBlur"></feBlend>
          </filter>
       </defs>
       <g transformOrigin="0 0" transform="scale(1,1)translate(-92,-199)">
          <g></g>
          <g>
             <g style="visibility: visible;">
                <image id="img1" x="235" y="433" width="101" height="84.9" xlink:href="data:image/png;base64,"></image>
             </g>
             <g style="visibility: visible;">
                <image id="img2" x="336" y="436.95" width="19.17" height="77" xlink:href="data:image/png;base64,"></image>
             </g>
             <g style="visibility: visible;">
                <image id="img3" x="355.17" y="430" width="114.16" height="89.95" xlink:href="data:image/png;base64,"></image>
             </g>
             <g style="visibility: visible;">
                <image  id="img4" x="100" y="212" width="58.45" height="58.45" xlink:href="data:image/png;base64,"></image>
             </g>
             <g style="visibility: visible;">
                <image id="img5" x="624" y="207" width="76" height="76" xlink:href="data:image/png;base64,"></image>
             </g>
          </g>
          <g></g>
          <g></g>
       </g>
    </svg>
    <div class="resize-sensor" style="position: absolute; inset: 0px; overflow: hidden; z-index: -1; visibility: hidden;">
       <div class="resize-sensor-expand" style="position: absolute; left: 0; top: 0; right: 0; bottom: 0; overflow: hidden; z-index: -1; visibility: hidden;">
          <div style="position: absolute; left: 0px; top: 0px; transition: all 0s ease 0s; width: 100000px; height: 100000px;"></div>
       </div>
       <div class="resize-sensor-shrink" style="position: absolute; left: 0; top: 0; right: 0; bottom: 0; overflow: hidden; z-index: -1; visibility: hidden;">
          <div style="position: absolute; left: 0; top: 0; transition: 0s; width: 200%; height: 200%"></div>
       </div>
    </div>
 </div>
</template>

<script>
    export default {
      data() {
        return {
         startX: 0,
         startY: 0,
         endX: 0,
         endY: 0,
         startX1: 0,
         startY1: 0,
         endX1: 0,
         endY1: 0,
         progress: 0
          }
        },
      mounted() {
       this.fly();
      },
      methods: {
          fly() {
             const image1 = document.getElementById("img1");
             const image2 = document.getElementById("img4");
             const image3 = document.getElementById("img3");
             const image4 = document.getElementById("img5");
            //  const position = image2.getBBox();
            //  image1.setAttribute("x", position.x);
            //  image1.setAttribute("y", position.y);
             const startPosition = image1.getBBox();
             const endPosition = image2.getBBox();
             const startPosition1 = image3.getBBox();
             const endPosition1 = image4.getBBox();
             this.startX = startPosition.x;
             this.startY = startPosition.y;
             this.endX = endPosition.x;
             this.endY = endPosition.y;
             this.startX1 = startPosition1.x;
             this.startY1 = startPosition1.y;
             this.endX1 = endPosition1.x;
             this.endY1 = endPosition1.y;
             this.animate();
          },
          animate() {
            this.progress += 0.003; // 调整此值以改变动画速度
            const image1 = document.getElementById("img1");
            const image2 = document.getElementById("img3");
            const image3 = document.getElementById("img2");
            if (this.progress < 1) {
               const newX = this.startX + (this.endX - this.startX) * this.progress;
               const newY = this.startY + (this.endY - this.startY) * this.progress;
               const newX1 = this.startX1 + (this.endX1 - this.startX1) * this.progress;
               const newY1 = this.startY1 + (this.endY1 - this.startY1) * this.progress;

               image1.setAttribute("x", newX);
               image1.setAttribute("y", newY);
               image2.setAttribute("x", newX1);
               image2.setAttribute("y", newY1);
               // image3.setAttribute("opacity",0);
               requestAnimationFrame(this.animate);
            } else {
               // 完成动画，将image1移动到image2的位置
               image1.setAttribute("x", this.endX);
               image1.setAttribute("y", this.endY);
               image2.setAttribute("x", this.endX1);
               image2.setAttribute("y", this.endY1);
               image1.setAttribute("opacity",0); 
               image2.setAttribute("opacity",0);
               image3.setAttribute("opacity",0);
            }
         } 
      },
      }
     
    </script>